import {useState, useEffect} from 'react';
import React, {Component} from 'react';
import "./App.css"
import Button from 'react-bootstrap/ToggleButton';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const serverRoot = "http://localhost:3300";

class LogInPage extends Component {
    constructor(props) {
      super(props);
    }
    async onClick() { 
      try {
        let response = await axios.get(serverRoot+"/manager/employee-list/");
        console.log(response)
      }
      catch(e) {
        alert("Server is not running.");
      }
    }
    render () {
      if (!this.state.loggedIn) {
        return (
          <>
          <h1>Log-In Page</h1>
          <Button onClick={this.onClick} variant="primary">Primary</Button>{' '}
          </>
          );
      }
      else {
        return (
          <>
          <h1>Logged In</h1>
          </>
          );
      }
    }
}

export default LogInPage;
